class Solution {
public:
    int maxOperations(string s) {
        int cnt = 0;
        int ans = 0;
        for(int i=0;i<s.length();i++){

            if(s[i]=='1'){
                cnt++;
                cout<<"i : "<<i<<"cnt : "<<cnt<<endl;
                continue;
            }
            while(s[i]=='0')i++;
            i--;
            ans+=cnt;
        }
        return ans;
    }
};
